import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

export default function NavCenter() {
  return (
    <NavCenterWrap>
      <Category>
        <span>카테고리</span>
      </Category>

      <Center>
        <li>
          <NavLink to="/newproduct">신상품</NavLink>
        </li>
        <li>
          <span>베스트</span>
        </li>
        <li>
          <span>알뜰쇼핑</span>
        </li>
        <li>
          <span>특가/혜택</span>
        </li>
      </Center>

      <InfoDelivery>
        <span>샛별・택배</span>
        배송안내
      </InfoDelivery>
    </NavCenterWrap>
  );
}

export const NavCenterWrap = styled.div`
  position: relative;
  display: flex;
  -webkit-box-pack: justify;
  justify-content: space-between;
  width: 1050px;
  height: 56px;
  margin: 0px auto;
  padding-top: 18px;
`;

export const Category = styled.div`
  display: flex;
  -webkit-box-align: center;
  align-items: center;
  height: 100%;
  & span {
    font-size: 16px;
    font-weight: 500;
    line-height: 20px;
    letter-spacing: -0.3px;
    color: rgb(51, 51, 51);
  }
`;

export const Center = styled.ul`
  flex: 0 0 0%;
  display: flex;
  list-style-type: none;

  & li {
    display: flex;
    -webkit-box-pack: center;
    justify-content: center;
    width: 150px;
    height: 55px;
    line-height: 20px;
    text-align: center;
  }
`;

export const NavLink = styled(Link)`
  text-decoration: none;
  height: fit-content;
  font-size: 16px;
  font-weight: 500;
  cursor: pointer;
  color: rgb(95, 0, 128);
`;

export const InfoDelivery = styled.div`
  height: 32px;
  padding: 6px 16px;
  border-radius: 18px;
  border: 1px solid rgb(238, 238, 238);
  color: rgb(102, 102, 102);
  font-size: 13px;
  line-height: 16px;
  letter-spacing: -0.32px;
`;
